class Solution(object):
    def minimumChanges(self, s, k):
        n = len(s)

        def cost(l, r):
            counts = [0] * 26
            for i in range(l, r + 1):
                counts[ord(s[i]) - ord('a')] += 1
            return (r - l + 1) // 2 - max(counts)

        def dp(i, k):
            if k == 1:
                return cost(0, i)
            if memo[i][k] != -1:
                return memo[i][k]
            min_cost = float('inf')
            for j in range(k - 1, i):
                min_cost = min(min_cost, dp(j, k - 1) + cost(j + 1, i))
            memo[i][k] = min_cost
            return min_cost

        memo = [[-1] * (k + 1) for _ in range(n)]
        return dp(n - 1, k)
